import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import BookList from './components/BookList.component';
import EditBook from './components/EditBook.component';
import CreateBook from './components/CreateBook.component';
import CreateAuthor from './components/CreateAuthor.component';

function App() {
  return (
    <Router>
      <Navbar />
      <br />
      <Route path="/" exact component={BookList} />
      <Route path="/edit/:id" component={EditBook} />
      <Route path="/create" component={CreateBook} />
      <Route path="/author" component={CreateAuthor} />
    </Router>
  );
}

export default App;
